import React, { Component } from 'react';
import { CardList } from './components/card-list/card-list.component'
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      races: []
    }
  }

  componentDidMount() {
    fetch("http://jsonplaceholder.typicode.com/users")
    .then(response => response.json())
    .then(users => this.setState({ races: users}))
  }

  render() {
    return (
        <div className="App">
          <CardList name="Lewis"><h1>Lewis</h1></CardList>
          {
            this.state.races.map(race => <h1 key={race.id}> { race.name } </h1>)
          }
        </div>
      );
  }
}

export default App;
